import jsondef sql_data_to_dict(eqx_parsed):    res = dict()    res['id'] = eqx_parsed.id    res['created_time'] = eqx_parsed.created_time    res['name'] = eqx_parsed.name    res['view_oss'] = eqx_parsed.view_oss    res['ranking'] = eqx_parsed.ranking    res['scene_path'] = eqx_parsed.scene_path    res['view_url'] = eqx_parsed.view_url    res['view_size'] = json.loads(eqx_parsed.view_size)    res['price'] = eqx_parsed.price    res['color'] = eqx_parsed.color    res['heat'] = eqx_parsed.heat    res['layer'] = json.loads(eqx_parsed.layer)    res['tdate'] = eqx_parsed.tdate    res['type'] = eqx_parsed.type    return res